import "./App.css";

const cols = new Array(10).fill(1);
const rows = new Array(50).fill(1);

function App() {
  return (
    <main>
      <section></section>
      <section></section>
      <section>
        <table>
          <thead>
            {cols.map(() => (
              <th>a</th>
            ))}
          </thead>
          <tbody>
            {rows.map(() => (
              <tr>
                {cols.map(() => (
                  <td>{rows.map(() => "a")}</td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      </section>
    </main>
  );
}

export default App;
